import { StyleSheet } from "react-native";

const styles=StyleSheet.create({
    container:{
        width: '100%',
        padding: 10,

    },

    button:{
        backgroundColor:'#F5EBEB',
        height:40,
        justifyContent: 'center',
    },

    text:{
        alignItems: 'center',

    },
});

export default styles;
